var __assign = (this && this.__assign) || Object.assign || function(t) {
    for (var s, i = 1, n = arguments.length; i < n; i++) {
        s = arguments[i];
        for (var p in s) if (Object.prototype.hasOwnProperty.call(s, p))
            t[p] = s[p];
    }
    return t;
};
import { ReactBits } from '../../ReactBits';
import { Animated, Dimensions, Easing, Image, Platform, StyleSheet, Text, Touchable, View, } from 'react-native-web';
import { createTouchable } from '../../modules/Touchable';
import StyleRegistry from 'react-native-web/dist/apis/StyleSheet/registry';
var emptyObject = {};
var resolve = function (style) {
    return StyleRegistry.resolve(style) || emptyObject;
};
ReactBits.inject({
    View: View,
    Text: Text,
    Image: Image,
    Easing: Easing,
    Animated: Animated,
    Dimensions: Dimensions,
    StyleSheet: __assign({}, StyleSheet, { resolve: resolve }),
    Platform: {
        OS: Platform.OS,
        Version: Platform.Version
    },
    Touchable: createTouchable(Animated, StyleSheet, Platform, Touchable.Mixin)
});
